      doc.setFontSize(12);
      doc.text('Total Parcial = '+ parseFloat(cerrado_bs).toFixed(2) + ' Bs', 10, doc.autoTable.previous.finalY + 10);
      doc.text('Saldo Acumulado Parcial = '+ parseFloat(saldo).toFixed(2) + ' Bs', 10, doc.autoTable.previous.finalY + 20);
